import React from 'react';
import Footer from './Components/Footer';
import NavBar from './Components/NavBar';
import WalletContent from './Components/WalletContent';

const WalletPage = () => (


    <div>
        <header><NavBar /></header>
        <WalletContent/>
        <Footer/>
    </div>
);


export default WalletPage;
